import React, { Component } from 'react';
// import logo from './logo.svg';

import NavBar from './component/navbar/NavBar';
import './App.css';
import { MuiThemeProvider } from 'material-ui/styles/muiThemeProvider';

class App extends Component {
  render () {
    return (
      <MuiThemeProvider>
          <div>
            <NavBar />
          </div>
      </MuiThemeProvider>
    )
  }
}

export default App;
